sys_variable_value.value:
(function(outputs, steps, stepResult, assertEqual)
{
	var test = new x_snc_devtools.TestAPI(outputs, steps, stepResult, assertEqual);
	
	test.SetResult(true);

	function TestCase_CleanUpSysDictionaryObject(vObject, vExpected)
	{
		function TestCase_CleanUpSysDictionaryObject_CheckResult(vInput,vExpected,vResult)
		{
			vSysDictionaryObject = vInput['sys_dictionary Object'];
			if (x_snc_devtools.IsObject(vSysDictionaryObject) == false)
			{
				if (x_snc_devtools.IsValidRecord(vSysDictionaryObject) == false)
				{
					return x_snc_devtools.IsEqual(vSysDictionaryObject,vResult); 
				}
			}
			var aKeys = x_snc_devtools.GetKeys(vResult);
			if (x_snc_devtools.ArrayValueExists(aKeys,'reference') == true)
			{
				return false;
			}
			if (x_snc_devtools.ArrayValueExists(aKeys,'sys_mod_count') == true)
			{
				return false;
			}	
			if (x_snc_devtools.ArrayValueExists(aKeys,'condition') == true)
			{
				return false;
			}				
			return true;
		}

		test.TestCase(
			'Function CleanUpSysDictionaryObject()',
			CleanUpSysDictionaryObject,
			{
				'sys_dictionary Object': vObject
			},
			vExpected,
			TestCase_CleanUpSysDictionaryObject_CheckResult);
	}

	TestCase_CleanUpSysDictionaryObject(null,null);

	var grSysDictionary = x_snc_devtools.GetRecord('sys_dictionary','0b2db1e51b59b5100e0b2f836b4bcbe1');
	TestCase_CleanUpSysDictionaryObject(grSysDictionary,null);
	
	return test.GetResult();
	
})(outputs, steps, stepResult, assertEqual);
